INSERT INTO `novedades` (`id_novedad`, `ci_usuario`, `novedad`, `fecha`, `hora`) VALUES
(1, '8677688CB', '14 oct. Entel llamo para coordinar los mÃ³viles faltando 25 min. para las 10, no se mando mÃ³vil en la madrugada ya que se olvidaron indicarnos ese recojo.\r\nEl dÃ­a de ayer 17 oct. se llamo a Entel para coordinar los mÃ³viles en vista que faltaban 20 min. para las 10 y aun no llamaban.\r\nse cubriÃ³ con normalidad las carreras asignadas por Entel', '2016-10-18', '09:12:58'),
(2, '8677688CB', 'mÃ³vil 24 llamo indicando que entro a chaperia desde el lunes 17 al viernes 21 oct. pide permiso para esos 5 dias', '2016-10-18', '10:13:24'),
(3, '8677688CB', 'nuevamente los de Entel se olvidan llamar a las 9 para confirmar la cantidad de mÃ³viles que solicitaran el resto de la noche ayer llame 9.45 para confirmar los moviles', '2016-10-27', '10:10:11'),
(4, '8677688CB', 'el 22/10 mÃ³vil 24 recogiÃ³ usuario de Entel la srta. Carla que no fue a su domicilio se hizo dejar en la corazonistas modificando la ficha de 18bs a 10bs', '2016-10-27', '10:14:06'),
(5, '8677688CB', 'El dÃ­a viernes 28 de octubre llamaron de Entel aprox. 21.00  para coordinar mÃ³viles indicando un solo recojo para madrugada (usuario Nancy). llamando nuevamente a las 12.00 media noche para pedir otro mÃ³vil (usuario Gery) donde hubo una confusiÃ³n de horas motivo por el cual el mÃ³vil se le mando con un retraso.\r\nEl dÃ­a sÃ¡bado 29 coordinaron 2  madrugadas 5.00 am a Juana mÃ³vil 73 fue a recoger al usuario pero nadie salio del domicilio y se retiro, 5.30 am a Jhovana la recogiÃ³ el mÃ³vil 77 con un leve retraso pero hizo llegar al usuario en hora.   ', '2016-10-31', '22:47:04'),
(6, '8677688CB', 'Entel debe fichas recojos madrugadas \r\n01/10 Jose Arce 05.30 am lo recogiÃ³ mÃ³vil \r\n07/10  Gery 05.00 am lo recogiÃ³ mÃ³vil 85\r\n08/10  Juana 05.00 am la recogiÃ³ mÃ³vil 55\r\n15/10 Katerin 05.30 am la recogiÃ³ mÃ³vil JJ\r\n21/10 Alexandra 05.00 am la recogiÃ³ mÃ³vil 73 - Lizbeth 05.30 am la recogiÃ³ mÃ³vil 73\r\n22/10 Katerine 05.30 am la recogiÃ³ mÃ³vil 65 - Lizbeth 06.00 am la recogiÃ³ mÃ³vil 31 \r\n', '2016-11-01', '08:53:19'),
(7, '8677688CB', 'Cuando se coordina los mÃ³viles para las madrugadas pedimos la direcciÃ³n del usuario y algÃºn numero de referencia por si el mÃ³vil no conoce el domicilio o no puede dar con el mismo y muchas veces no se nos da ese dato indicando que no lo tienen a la mano y en caso de los telÃ©fonos que no tienen  (nosotros buscamos direcciones de usuarios en reportes anteriores).\r\nSe manda los mÃ³viles a los domicilios en las madrugadas en hora pero hay usuarios que salen con mora de 15 min o mas y quieren que el mÃ³vil vaya mas rÃ¡pido de lo de costumbre para que lleguen en hora.\r\n ', '2016-11-03', '06:33:04'),
(8, '8677688CB', 'El dÃ­a lunes 31 de octubre a las 23.30 pm se recogiÃ³ dos usuarios de Entel uno de ellos subiÃ³ con unos pedestales los acomodo en el asiento de adelante y un parlante grande que lo llevo atrÃ¡s lado suyo  causando la  incomodidad del otro usuario \r\n', '2016-11-03', '06:49:42'),
(9, '8677688CB', 'El dÃ­a de ayer 10 de Nov. a las 22.00 para coordinar recojo de madrugada con Carla Rosario Cruz donde se nos indico dos.\r\nAndres tenia que ingresar a las 05.00 am se le mando el mÃ³vil 04.30 am al ver que el usuario no salia el operador de turno lo llamo al celular quien le contesto indicando que el tiene el dÃ­a libre que su recojo era para maÃ±ana, el mÃ³vil asignado para ese recojo se retiro\r\nel 2do mÃ³vil se asigno para Carola que tenia que llegar a Entel a las 05.30 se le mando el mÃ³vil como el usuario no salia el operador de turno la llamo indicando q su mÃ³vil estaba esperando la srta. le indico que su recojo es para las 05.30 porque ella ingresa a las 06.00 se hizo aguardar al mÃ³vil media hora ', '2016-11-11', '10:00:45'),
(10, '8677688CB', 'el dÃ­a jueves 12 de noviembre se mando mÃ³vil a hrs 4.30 am a domicilio Andres quien ingresaba a Entel a las 5.00 el mÃ³vil aguardo 20 min en puerta del domicilio\r\n ', '2016-11-15', '08:42:43'),
(11, '8677688CB', 'Se coordino con Carla Cruz el dÃ­a 15 de nov. el recojo de Marlen quien ingresaba a Entel a las 00.00 el mÃ³vil fue a su domicilio, el usuario no salio se le hizo linea baja y la seÃ±ora Marlen indico q era su libre q el mÃ³vil se retire', '2016-11-16', '20:16:10'),
(12, '8677688CB', 'llamo la seÃ±ora Marisol indicando q porvavor vuelva a mandar el detalle de los mÃ³viles solicitados corrigiendo los mÃ³viles q ella solicito.\r\nindica la seÃ±ora Marisol que el detalle q enviaron es incorrecto porque no solicito tantos mÃ³viles y con altas tarifas  ', '2016-11-16', '20:28:34'),
(13, '8677688CB', 'El dÃ­a martes 15 de Nov. se coordino con Carla Cruz dos mÃ³viles para las 22.00, los usuarios del segundo mÃ³vil no estaban en ruta (Juan y Rosmery) uno de los usuarios se le llevo por el psj zoolÃ³gico y a otro por la zona chimba el mÃ³vil no lo reporto ese dÃ­a ya que no trabaja mucho por las noches .\r\nel dÃ­a 16 de nov nuevamente se coordino con Carla Cruz  2 mÃ³viles para las 10 y los usuarios del primer mÃ³vil no estaban en ruta  (Juan Y Rosmery) se hizo la observaciÃ³n a Entel y la respuesta fue que no es la primera vez que esos usuarios van juntos y nunca hubo quejas de eso pero que se ponga ficha observada revisando fechas anteriores se observo que los usuarios mencionados siempre iban en distintos mÃ³viles  ', '2016-11-21', '10:02:47'),
(14, '8677688CB', 'El dÃ­a de ayer miÃ©rcoles 23 de Nov. se coordino mÃ³viles para Entel a hrs 21.44 con Carla Cruz indicando la cantidad de mÃ³viles para recoger de Entel a domicilios tambiÃ©n los trasnoches de domicilios a Entel se le pregunto si habÃ­a recojo de madrugada e indico que no que falta confirmar que llamarÃ­a mas tarde para confirmarnos \r\nNo se pidiÃ³ mÃ³viles para recojo de madrugada', '2016-11-24', '10:56:22');
